export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},ldtYiyPitn:{data:{id:963,attributes:{imdbId:"tt0058056",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYWNmYmE5NzUtMWE4NC00NzU1LTk2ZjItMjk0YWNkYWRhZWVkXkEyXkFqcGdeQXVyMjc1NjE1MzM@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"}],item_lang:{data:{id:1626,attributes:{title:b,plot:"When Emil travels by bus to Berlin to visit his grandmother and his cousin, his money is stolen by a crook who specializes in digging tunnels. Emil must get the money back as it is for his grandmother. While following the thief, Emil runs into Gustav, an enterprising young boy who gathers up all his friends to help Emil find the money. Emil's cousin also gets involved and they get into more trouble than they bargained for when Emil's pickpocket turns out to be mixed up with a couple of notorious bank robbers.",slug:"emil-and-the-detectives"}}},books:{data:[{id:5702,attributes:{title:b,description:"'Password Emil!' If Mrs Tischbein had known the amazing adventures her son Emil would have in Berlin, she'd never have let him go. Emil is excited to be taking the train on his own for the first time. He doesn't like the look of his fellow passenger, the man in the bowler hat. Emil will just have to keep his wits about him and his money in his pocket. But Emil falls asleep and when he wakes up the man in the bowler hat is gone - and so is the money! Emil is determined to get it back. He teams upwith a gang of young detectives and so begins a hair-raising chase across Berlin to catch the dirty rotten thief...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=2p38DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e],firstBook:true,published:"2013-11-18",publisher:"Bloomsbury Publishing",subtitle:a}},{id:5703,attributes:{title:b,description:"\"Emil is travelling alone to his grandmother's house in the city. He is carrying money to her from his mother. Then a man on the train steals the money. Emil follows the thief and an exciting adventure begins, with lots of detectives, a lift boy, and a fight in a bank!\" -- back cover.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=fRhwbhEmCc0C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[h],firstBook:d,published:"1988-01-01",publisher:"Longman Group",subtitle:a}},{id:5704,attributes:{title:b,description:i,thumbnail:j,authors:[e],firstBook:d,published:k,publisher:l,subtitle:a}},{id:5705,attributes:{title:b,description:i,thumbnail:j,authors:[e],firstBook:d,published:k,publisher:l,subtitle:a}},{id:5706,attributes:{title:b,description:a,thumbnail:a,authors:[h],firstBook:d,published:"1965-01-01",publisher:a,subtitle:"A Story for Children"}}]}}},meta:{}}},prerenderedAt:1681309481972}}("","Emil and the Detectives","movie",null,"Erich Kastner","series",1,"Erich Kästner","On the train, his fellow passengers are impressed with how polite and grown-up Emil is, and the man in the bowler hat offers him some chocolate—but Emil keeps checking his coat pocket, where he’s pinned the money that he is taking to his grandmother. Soon, though, Emil finds himself getting sleepy . . . and the next thing he knows, the man in the bowler hat is gone— and so is the money! With the help of some new friends Emil becomes a detective and tracks the thief through the city. Filled with enduring themes of leadership, courage, and teamwork, and the delightful illustrations of Walter Trier, Emil and the Detectives is a rollicking, heartwarming tale come alive.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kTuEDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2007-11-01","Abrams"))